	const MTPDaccount_passwordInputSettings &v(c_account_passwordInputSettings());
	v.vflags.write(to);
	if (v.has_new_salt()) v.vnew_salt.write(to);
	if (v.has_new_password_hash()) v.vnew_password_hash.write(to);
	if (v.has_hint()) v.vhint.write(to);
